  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a study done on
  the Gardner Division of Mark Twain NWR to compliment ongoing neotropical migrant
  bird studies along the Upper Mississippi River in Iowa, Wisconsin and Minnesota.
